import React from 'react'
import { Typography, Grid, Box, Container, Link } from '@material-ui/core'
import { makeStyles } from '@material-ui/core/styles'
import InstagramIcon from '@material-ui/icons/Instagram'
import FacebookIcon from '@material-ui/icons/Facebook'
import TwitterIcon from '@material-ui/icons/Twitter'

const useStyles = makeStyles({
    footer: {
        textAlign: "left"
    }
});

export default function Footer() {
    const classes = useStyles();
    return (
        <footer className={classes.footer}>
            <Container maxWidth="lg">
                <Grid container spacing="5">
                    <Grid item xs="12" sm="6" md="3">
                        <Box marginBottom="25px">Our Story</Box>
                        <Box marginBottom="25px">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</Box>
                        <Box>
                            <Link href="#" className={classes.iconLink}><FacebookIcon style={{color:'#757575'}}/></Link>
                            <Link href="#" className={classes.iconLink}><TwitterIcon style={{color:'#757575'}}/></Link>
                            <Link href="#" className={classes.iconLink}><FacebookIcon style={{color:'#757575'}}/></Link>
                        </Box>
                    </Grid>
                </Grid>
            </Container>
        </footer>
    )
}
